import React, { useEffect, useState } from "react";
import "./App.css";

function App(props) {
  useEffect(
    () => {
      document.getElementById("button").addEventListener("click", () => {
        alert("test");
      });
    },
    [
      /*Loads once upon first rendering*/
    ]
  );
  console.log(props.primaryX);
  return (
    <body className="App-body">
      <div className="container">
        <div className="content">
          Primay: {props.primaryX}, {props.primaryY}
          Secondary: {props.secondaryX}, {props.secondaryY}
        </div>
        <div className="button">
          <button id="button">Display</button>
        </div>
      </div>
    </body>
  );
}

export default App;
